import React, { useEffect, useRef } from "react";
import "@arcgis/core/assets/esri/themes/light/main.css";
import MapView from "@arcgis/core/views/MapView";
import WebMap from "@arcgis/core/WebMap";
import FeatureLayer from "@arcgis/core/layers/FeatureLayer";
import Graphic from "@arcgis/core/Graphic";



export const MapComponent = () => {
  const mapDiv = useRef<HTMLDivElement>(null);

  useEffect(() => {
    if (mapDiv.current) {



      const webmap = new WebMap({
        basemap: "modern-antique",
      });




      const view = new MapView({
        map: webmap,
        container: mapDiv.current,
        center: [10, 50], // Example center (Europe)
        zoom: 4, // Adjust zoom as needed
      });



      const regionsLayer = new FeatureLayer({
        url: "https://services.arcgis.com/exampleFeatureLayerURL",
      });

      webmap.add(regionsLayer);

      view.when(() => {
        console.log("Map and View are ready");
      }, (error :any) => {
        console.error("Error loading MapView: ", error);
      });
    }

    return () => {
      if (mapDiv.current) {
        mapDiv.current.innerHTML = "";
      }
    };
  }, []);

  return (
    
      <div>
        <h2 className="header">Get a European Recipe!</h2>
     
          <div ref={mapDiv} style={{ height: "100vh", width: "100%" }} />
      </div>
    
  );
};

export default MapComponent;
